// VN function
void clear_chapter_data(){ // clear chapter valuables
	subchapter = 0;
	select_choice = 1;
	select_choice_time = 0;
}

void change_chapter(int target_chapter){ // change chapter
	clear_chapter_data();
	chapter = target_chapter;
}

void input_chapter_code(){ // get number of chapter code player type
	char num_input[1] = " ";
	if(back_space){
		num_input[0] = 'e';
	}else if(n0){
		num_input[0] = '0';
	}else if(n1){
		num_input[0] = '1';
	}else if(n2){
		num_input[0] = '2';
	}else if(n3){
		num_input[0] = '3';
	}else if(n4){
		num_input[0] = '4';
	}else if(n5){
		num_input[0] = '5';
	}else if(n6){
		num_input[0] = '6';
	}else if(n7){
		num_input[0] = '7';
	}else if(n8){
		num_input[0] = '8';
	}else if(n9){
		num_input[0] = '9';
	}
	if (num_input[0]!= ' ' && game_time > chapter_teleport_time + 0.2 && (strlen(chapter_code) < 4 || num_input[0] == 'e')){
			chapter_teleport_time = game_time;
			if(num_input[0] == 'e'){
				chapter_code[strlen(chapter_code)-1] = '\0';
			}else{
				strncat(chapter_code,num_input,1);
			}
			
			printf("\e[%d;%dH",19,12); // set cursor position (y,x)
			printf("\e[2m\e[1m____\e[0m");
			printf("\e[%d;%dH",19,12); // set cursor position (y,x)
			printf("\e[2m\e[1m%s\e[0m",chapter_code);
		}
}

void show_chapter_code(){ // printf chapter code 
	printf("\e[%d;%dH",29,102); // set cursor position (y,x)
	snprintf(chapter_code, sizeof(chapter_code), "%d%d%d%d", chapter,garlic,knowOphelia,holywater);
	printf("\e[0mchapter code:%s", chapter_code);
}

