void game_progress(){  // call function for each chapter and fight  // call every tick
	if (current_fight != 0)
	{
		combat_progress();
	}
	else if (chapter == 0)
	{
		chapter_0();
	}
	else if (chapter == 1)
	{
		chapter_1();
	}
	else if (chapter == 2)
	{
		chapter_2();
	}
	else if (chapter == 3)
	{
		chapter_3();
	}
	else if (chapter == 4)
	{
		chapter_4();
	}
	else if (chapter == 5)
	{
		chapter_5();
	}
	else if (chapter == 6)
	{
		chapter_6();
	}
	else if (chapter == 7)
	{
		chapter_7();
	}
	else if (chapter == 8)
	{
		chapter_8();
	}
	else if (chapter == 9)
	{
		chapter_9();
	}
	else if (chapter == 10)
	{
		chapter_10();
	}
	else if (chapter == 11)
	{
		chapter_11();
	}
}


//main bruh
void main(){
	start_setup();
	while (chapter != -1){ // game loop
		update_game();
		//display_var();  // for debug only
		game_progress();
	}
	// end game
}

